'=>'الخام يمنع كل من fsockopen و cURL - خدمات باي بال IPN والخدمات التي تتصل بخوادم أخرى لن تعمل. تواصل مع خادمك لتفعيلها.','Theme'=>'القالب','The name of the current active theme.'=>'اسم الثيم المفعل حالياً','The installed version of the current active theme.'=>'الإصدار المنصب من الثيم المفعل حالياً','%s is available'=>'%s متوفر','Author URL'=>'رابط المؤلف','Overrides'=>'التجاوزات','Enter price (%s)'=>'ادخل السعر (%s)','Enter sale price (%s)'=>'ادخل سعر التخفيض (%s)','Length (%s)'=>'الطول (%s)','Width (%s)'=>'العرض (%s)','Height (%s)'=>'الارتفاع (%s)','Backorders?'=>'طلبات مؤجلة؟','Database'=>'قاعدة البيانات','The theme developers URL.'=>'رابط مطوري القالب.','The coupon code already exists'=>'تم استخدام القسيمة مسبقاً!','Error: %s'=>'خطأ: %s','API Version'=>'نسخة الـ API','Displays whether or not WordPress is in Debug Mode.'=>'العرض فى وضع التصحيح او لا','The current language used by WordPress. Default = English'=>'اللغة الحالية المستخدمة بواسطة ووردبريس. الافتراضي = اللغة الإنجليزية','Information about the web server that is currently hosting your site.'=>'معلومات عن خادم الويب الذي يستضيف حاليا موقع الويب الخاص بك.','The version of PHP installed on your hosting server.'=>'إصدار PHP مثبتة على الخادم المضيف الخاص بك.','The largest filesize that can be contained in one post.'=>'أكبر حجم الملف يمكن أن تكون موجودة في وظيفة واحدة.','The amount of time (in seconds) that your site will spend on a single operation before timing out (to avoid server lockups)'=>'مقدار الوقت (بالثواني) أن موقع الويب الخاص بك سوف تنفق على عملية واحدة قبل انتهاء المهلة (لتجنب مقار الاحتجاز الخادم)','The maximum number of variables your server can use for a single function to avoid overloads.'=>'الحد الأقصى لعدد المتغيرات يمكن استخدام الخادم الخاص بك لوظيفة واحدة لتجنب الزائدة.','Suhosin is an advanced protection system for PHP installations. It was designed to protect your servers on the one hand against a number of well known problems in PHP applications and on the other hand against potential unknown vulnerabilities within these applications or the PHP core itself. If enabled on your server, Suhosin may need to be configured to increase its data submission limits.'=>'Suhosin هو نظام حماية متقدم لنظام PHP. وقد صمم هذا البرنامج لحماية الخوادم ضد عدد من المشاكل المعروفة في تطبيقات PHP، ومن جهة يعمل على الحماية ضد الضعف للمصفوفات المجهولة المحتملة داخل هذه التطبيقات أو PHP الأساسية نفسها. إذا رغبت في تمكين هذه المكتبة على الخادم الخاص بك، قد تحتاج تركيب مكتبة Suhosin على الخادم الخاص بك','The version of MySQL installed on your hosting server.'=>'صيغة MySQL على خادم الاستضافة الخاص بك.','The largest filesize that can be uploaded to your WordPress installation.'=>'أكبر حجم الملف الذي يمكن تحميله على تثبيت وورد الخاص بك.','The default timezone for your server.'=>'الزمن الافتراضي للخادم الخاص بك.','Default timezone is %s - it should be UTC'=>'التوقيت الافتراضي هو %s - ينبغي أن يكون يونايتد تكنولوجيز','Payment gateways can use cURL to communicate with remote servers to authorize payments, other plugins may also use it when communicating with remote services.'=>'بوابات الدفع يمكن ان تستخدم cURL لتتصل بالخوادم عن بعد من اجل ان تتم عمليه الدفع , ومن الممكن ان تستخدمها اضافات اخرى ايضا لتصل بخدمات عن بعد .','Some webservices like shipping use SOAP to get information from remote servers, for example, live shipping quotes from FedEx require SOAP to be installed.'=>'بعض خدمات الشبكة مثل الشحن تستخدم SOAP للحصول على معلومات من خوادم اخرى عن بعد، على سبيل المثال، الشحن المباشرة من فيديكس تتطلب SOAP ليتم تثبيتها.','HTML/Multipart emails use DOMDocument to generate inline CSS in templates.'=>'HTML/Multipart لرسائل البريد الإلكتروني استخدام DOMDocument لتوليد CSS بداخل القوالب الخاصة بالبريد.','Your server does not have the %s class enabled - HTML/Multipart emails, and also some extensions, will not work without DOMDocument.'=>'السيرفر الخاص بك لا يحتوي على كلاس %s او انه غير مفعل لذلك بعض الملحقات ربما لن تعمل بشكل صحيح مثل بدون DOMDocument - HTML/Multipart , .','GZip (gzopen) is used to open the GEOIP database from MaxMind.'=>'GZip (gzopen) يستخدم لفتح قاعدة بيانات GEOIP من  MaxMind.','PayPal uses this method of communicating when sending back transaction information.'=>'باي بال يستخدم هذا الأسلوب في التواصل عند إرسال معلومات المعاملة مرة أخرى .','WooCommerce plugins may use this method of communication when checking for plugin updates.'=>'قد تستخدم إضافة ووكومرس طرق للاتصال لفحص الإصدارات والترقية','Table does not exist'=>'الجدول غير موجود','Network enabled'=>'تم تفعيل الشبكه','Does your site force a SSL Certificate for transactions?'=>'هل موقعك به شهادة SSL للمعاملات الحية؟','What currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'ما هى أسعار العملات في الكتالوج وأى عمله ستستخدم فى الدفع.','The position of the currency symbol.'=>'هذا الإعداد يتحكم بمكان ظهور رمز العملة.','The thousand separator of displayed prices.'=>'فاصل ألف للأسعار المعروضة.','The decimal separator of displayed prices.'=>'الفاصل العشري للأسعار المعروضة.','The number of decimal points shown in displayed prices.'=>'هذا الخيار يتحكم بعدد العشرات المعروضة بعد الفاصلة في سعر المنتج.','A list of taxonomy terms that can be used in regard to order/product statuses.'=>'قائمة شروط التصنيف التي يمكن استخدامها فيما يتعلق بحالات الطلب/المنتج.','Displays whether or not the current theme is a child theme.'=>'يعرض ما إذا كان أو لم يكن السمة الحالية هو موضوع الطفل.','The name of the parent theme.'=>'اسم القالب الأصل','The installed version of the parent theme.'=>'الإصدار المثبت من القالب الأصل.','The parent theme developers URL.'=>'رابط مطوري القالب الأصل.','Displays whether or not the current active theme declares WooCommerce support.'=>'عرض ما اذا كان القالب الخاص بك يدعم دعم اضافه WooCommerce','This section shows any files that are overriding the default WooCommerce template pages.'=>'يعرض هذا القسم الملفات التي تحل محل صفحات القالب الافتراضي WooCommerce.','<strong>Welcome to WooCommerce</strong> &#8211; You&lsquo;re almost ready to start selling :)'=>'<strong>مرحبا بكم في WooCommerce</strong> - أنت جاهز تقريبا لبدء في البيع على متجرك الالكتروني :) نتمنى لك رزقا حلالً طيباً','Run the Setup Wizard'=>'تشغيل معالج الإعداد','Placeholder'=>'ماسك المكان','Deleted %s'=>'حذفت %s','The root URL of your site.'=>'الرابط الأساسي لموقعك.','The version of WordPress installed on your site.'=>'إصدار ووربريس المنصب على موقعك.','Whether or not you have WordPress Multisite enabled.'=>'اذا ماكنت تمتلك أكثر من تنصيبة ووردبريس في موقع واحد.','The maximum amount of memory (RAM) that your site can use at one time.'=>'الحد الأعلى للذاكرة العشوائية (RAM) الذي يستطيع موقعك إستخدامه في وقت واحد.','Visit plugin homepage'=>'زيارة الصفحة الرئيسية للإضافة','Force SSL'=>'فرض SSL','Page not set'=>'الصفحة لم تحدد','Version'=>'الإصدار','Templates'=>'القوالب','Tools'=>'أدوات','Logs'=>'السجلات','— No Change —'=>'— بلا تغيير —','Change to:'=>'تغيير إلى:','Sale'=>'سعر العرض','L/W/H'=>'طول\\عرض\\ارتفاع','Visibility'=>'عرض في','Catalog &amp; search'=>'القائمة و البحث','In stock?'=>'متوفر؟','Custom:'=>'تواريخ محددة:','Page settingCart'=>'السلة','Page settingCheckout'=>'التخليص والدفع','Copy'=>'نسخ','Force HTTP when leaving the checkout'=>'إجبار استخدام بروتوكول HTTP عند انهاء الطلب','These pages need to be set so that WooCommerce knows where to send users to checkout.'=>'يجب أن تكون هذه الصفحات معده مسبقًا ليتمكن ‪)‬ووكومرس‪(‬ من إرسال العملاء لصفحة إنهاء الطلب.','Endpoints are appended to your page URLs to handle specific actions during the checkout process. They should be unique.'=>'أسماء روابط النهاية تضاف إلى رابط الصفحة المعروضة لتنفيذ عمليات محددة أثناء إنهاء الطلب. يجب أن تكون مختلفة وسهلة الفهم.','This option lets you limit which countries you are willing to sell to.'=>'هذا الخيار يجعلك تحد من الدول التي ترغب في البيع لها.','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'يتحكم هذا الخيار بالعملة التي تعرض بها الأسعار في المتجر وبوابات الدفع التي تقبلها.','The base page can also be used in your <a href="%s">product permalinks</a>.'=>'اسم صفحة المتجر يمكن إستخدامه أيضًا في <a href="%s">الروابط الدائمة للمنتجات</a>.','Sort by most recent'=>'الترتيب حسب الأحدث','Add to cart behaviour'=>'سلوك الإضافة للسلة','Hold stock (for unpaid orders) for x minutes. When this limit is reached, the pending order will be cancelled. Leave blank to disable.'=>'تعليق المخزون (للطلبات الغير مدفوعة) بعد الدقائق المحددة. حين الوصول للحد المعطى من الدقائق، سيتم إلغاء الطلب. أتركه فارغًا للتعطيل.','Notifications'=>'التنبيهات','This controls which shipping address is used by default.'=>'يتحكم هذا الخيار بعنوان الشحن الإفتراضي.','Ship to all countries you sell to'=>'الشحن لجميع مناطق البيع','Ship to all countries'=>'الشحن لجميع الدول','Ship to specific countries only'=>'الشحن لدول محددة فقط','ID'=>'المعرف','Priority'=>'الأولوية','Choose a priority for this tax rate. Only 1 matching rate per priority will be used. To define multiple tax rates for a single area you need to specify a different priority per rate.'=>'اختر أولوية هذه الضريبة. تؤخذ ضريبة واحدة من نفس الأولوي فقظ. لتحديد أكثر من ضريبة على منطقة واحدة استخدم أولوية مختلفة لكل ضرية.','The options are &quot;Active&quot; (delivers payload), &quot;Paused&quot; (does not deliver), or &quot;Disabled&quot; (does not deliver due delivery failures).'=>'الخيارات هي &quot;فعال&quot; (لتوصيل الحمولة) أو &quot;متوقف مؤقتًا&quot; (عدم التوصيل) أو &quot;معطل&quot; (عدم التوصيل بسبب مشاكل).','Select when the webhook will fire.'=>'لإختيار وقت إطلاق الـ Webhook.','Action'=>'إجراء','Custom'=>'مخصص','URL where the webhook payload is delivered.'=>'رابط توصيل حمولة الـ Webhook.','Updated at'=>'تم تحديثه في','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'هذا لخيار هام حيث سيؤثر في إدخالك للأسعار. لن يتم تحديث المنتجات المتواجدة مسبقًا عند تغييره.','Optionally control which tax class shipping gets, or leave it so shipping tax is based on 